import regice from './assets/regice.png';
import video from './assets/video-bg.mov';
import './App.css';

// Main -----------------------------

export default function App() {
  return (
    <div className="App">
      <Video />
    </div>
  );
}

// Functions -------------------------

function Regice() {
  return (
    <img src={regice} width="300px" />
  );
}

function Video() {
  return (
    <video src={video} className='video-bg' autoplay controls muted />
  );
}
